- input: "TEXT\x1CC00097550\x1C.TEXT\x1C\x1CF3XA\x1CIn preparation for terminating
    Washington Division of URS Corporation Political Action Committee's FEC registration,
    the committee conducted an internal reconciliation to bring the cash on hand total
    of the report at mid-year 2009 in line with the bank balance.  Upon further review,
    it was determined that several checks that were disclosed as voided on the original
    Mid-Year 2009 Report had actually cleared the bank.  The committee has deleted
    those voided checks on the amended report. \n"
